import torch
import torch.nn as nn
import math
import torchvision
import torchvision.transforms as transforms

"""## ghost module
![image.png](data:image/png;base64,)
"""

class GhostModule(nn.Module):
  def __init__(self, in_channels, out_channels, primary_kernel_size=1, ratio = 2, dw_kernel_size=3, stride=1):
    super(GhostModule, self).__init__()
    self.ratio = ratio
    self.out_channels = out_channels

    self.init_channels = math.ceil(out_channels / ratio) # num of intrinsic channels
    self.new_channels = self.init_channels * (self.ratio - 1)

    self.primary_conv = nn.Conv2d(
       in_channels,
       self.init_channels,
       kernel_size = primary_kernel_size,
       stride = stride,
       padding = (primary_kernel_size - 1) // 2,
       bias = False
    )

    self.cheap_operations = nn.Conv2d(
      in_channels = self.init_channels,
      out_channels = self.new_channels,
      kernel_size = dw_kernel_size,
      stride = 1,
      padding = (dw_kernel_size - 1) // 2,
      groups = self.init_channels,
      bias = False
    )

  def forward(self, x):
    intrinsic_features = self.primary_conv(x)
    cheap_features = self.cheap_operations(intrinsic_features)
    out = torch.cat([intrinsic_features, cheap_features], dim = 1)
    return out[:, :self.out_channels, :, :]

"""## ghost bottleneck module
![image.png](data:image/png;base64,)
"""

# Ghost Bottleneck Module

class GhostBottleneck(nn.Module):
  def __init__(self, in_channels, hidden_dim, out_channels, dw_kernel_size, stride):
    super(GhostBottleneck, self).__init__()
    self.stride = stride

    # the main path
    self.ghost1 = GhostModule(
        in_channels,
        hidden_dim,
        primary_kernel_size = 1,
        ratio = 2,
        dw_kernel_size = dw_kernel_size
    )

    self.bn1 = nn.BatchNorm2d(hidden_dim)
    self.relu = nn.ReLU(inplace=True)

    if (self.stride == 2):
      self.dwconv = nn.Conv2d(
        in_channels = hidden_dim,
        out_channels = hidden_dim,
        kernel_size = dw_kernel_size,
        stride = stride,
        padding = (dw_kernel_size - 1) // 2,
        groups = hidden_dim, # depthwise conv
        bias = False
      )

      self.bn_dw = nn.BatchNorm2d(hidden_dim)

    # no relu after this second ghost module
    self.ghost2 = GhostModule(
        hidden_dim,
        out_channels,
        primary_kernel_size = 1,
        ratio = 2,
        dw_kernel_size = dw_kernel_size
    )

    self.bn2 = nn.BatchNorm2d(out_channels)

    if (stride == 1 and in_channels == out_channels):
      self.shortcut = nn.Identity()

    else:
      # downsampling layer in shortcut path
      shortcut_layers = []
      if stride == 2:
        shortcut_layers.append(nn.Conv2d(
            in_channels,
            in_channels,
            kernel_size = dw_kernel_size,
            stride = stride,
            padding = (dw_kernel_size - 1) // 2,
            groups = in_channels,
            bias = False
        ))

        shortcut_layers.append(nn.BatchNorm2d(in_channels))

      shortcut_layers.append(nn.Conv2d(
          in_channels,
          out_channels,
          kernel_size = 1,
          stride = 1,
          padding = 0,
          bias = False
      ))

      shortcut_layers.append(nn.BatchNorm2d(out_channels))

      self.shortcut = nn.Sequential(*shortcut_layers)


  def forward(self, x):
    identity = self.shortcut(x)

    # main path
    x = self.ghost1(x)
    x = self.bn1(x)
    x = self.relu(x)

    if (self.stride == 2):
      x = self.dwconv(x)
      x = self.bn_dw(x)

    x = self.ghost2(x)
    x = self.bn2(x)

    return x + identity

"""## ghost net
![image.png](data:image/png;base64,)
"""

class GhostNet(nn.Module):
  def __init__(self, num_classes=1000, width_mult=1):
    super(GhostNet, self).__init__()
    self.width_mult = width_mult

    # format
    # [expansion_size, out_channels, stride, dw_kernel_size]
    # paper uses 3x3 kernel size for all cheap operations

    self.config = [
      [16, 16, 1, 3],  # G-bneck, $112^2 \times 16$
      [48, 24, 2, 3],  # G-bneck, $56^2 \times 24$
      [72, 24, 1, 3],  # G-bneck, $56^2 \times 24$
      [72, 40, 2, 5],  # G-bneck, $28^2 \times 40$ (kernel 5x5)
      [120, 40, 1, 5], # G-bneck, $28^2 \times 40$ (kernel 5x5)
      [240, 80, 2, 3], # G-bneck, $14^2 \times 80$
      [200, 80, 1, 3], # G-bneck, $14^2 \times 80$
      [184, 80, 1, 3], # G-bneck, $14^2 \times 80$
      [184, 80, 1, 3], # G-bneck, $14^2 \times 80$
      [480, 112, 1, 3],# G-bneck, $14^2 \times 112$
      [672, 112, 1, 3],# G-bneck, $14^2 \times 112$
      [672, 160, 2, 5],# G-bneck, $7^2 \times 160$ (kernel 5x5)
      [960, 160, 1, 5],# G-bneck, $7^2 \times 160$ (kernel 5x5)
      [960, 160, 1, 5],# G-bneck, $7^2 \times 160$ (kernel 5x5)
      [960, 160, 1, 5],# G-bneck, $7^2 \times 160$ (kernel 5x5)
      [960, 160, 1, 5] # G-bneck, $7^2 \times 160$ (kernel 5x5)
    ]

    def make_divisible(v, divisor = 8):
      new_v = max(divisor, int(v + divisor / 2) // divisor * divisor)
      if (new_v < 0.9 * v):
        new_v += divisor
      return new_v

    def apply_width(v):
      return make_divisible(v * self.width_mult)


    # FIRST LAYER
    self.in_channels = apply_width(16)
    # self.conv1 = nn.Conv2d(3, self.in_channels, kernel_size=3, stride=2, padding=1, bias=False)
    self.conv1 = nn.Conv2d(3, self.in_channels, kernel_size=3, stride=1, padding=1, bias=False)
    self.bn1 = nn.BatchNorm2d(self.in_channels)
    self.relu = nn.ReLU(inplace=True)

    # GHOST BOTTLENECKS STACK
    self.bottlenecks = self.create_bottlenecks(apply_width)

    # FINAL LAYERS
    # conv2d 1x1
    self.out_channels = apply_width(960)
    self.conv_head = nn.Conv2d(self.in_channels, self.out_channels, kernel_size=1, stride=1, padding=0, bias=False)
    self.bn_head = nn.BatchNorm2d(self.out_channels)

    # avgpool 7x7
    self.avgpool = nn.AdaptiveAvgPool2d((1, 1))

    # fc layer
    self.classifier_conv = nn.Conv2d(self.out_channels, 1280, kernel_size=1, stride=1, padding=0, bias=True)
    self.fc = nn.Linear(1280, num_classes)

    self.initialize_weights()

  def initialize_weights(self):
    for m in self.modules():
      if isinstance(m, nn.Conv2d):
        nn.init.kaiming_normal_(m.weight, mode="fan_out", nonlinearity="relu")
        if m.bias is not None:
          nn.init.constant_(m.bias, 0)
      elif isinstance(m, nn.BatchNorm2d):
        nn.init.constant_(m.weight, 1)
        nn.init.constant_(m.bias, 0)
      elif isinstance(m, nn.Linear):
        nn.init.normal_(m.weight, 0, 0.01)
        nn.init.constant_(m.bias, 0)

  def create_bottlenecks(self, apply_width):
    layers = []
    for expsize, out_c, stride, dw_kernel, in self.config:
      hidden_dim = apply_width(expsize)
      out_channels = apply_width(out_c)

      layers.append(GhostBottleneck(
          in_channels=self.in_channels,
          hidden_dim=hidden_dim,
          out_channels=out_channels,
          dw_kernel_size=dw_kernel,
          stride=stride
      ))

      self.in_channels = out_channels # update in_channel for next upcoming block

    return nn.Sequential(*layers)


  def forward(self, x):
    # first layer
    x = self.conv1(x)
    x = self.bn1(x)
    x = self.relu(x)

    # bottlenecks
    x = self.bottlenecks(x)

    # head
    x = self.conv_head(x)
    x = self.bn_head(x)
    x = self.relu(x)

    x = self.avgpool(x)

    x = self.classifier_conv(x)
    x = self.relu(x)

    x = x.view(x.size(0), -1)
    x = self.fc(x)
    return x

