transform_train = transforms.Compose([
    transforms.RandomCrop(32, padding = 4),
    transforms.RandomHorizontalFlip(),
    transforms.ToTensor(),
    transforms.Normalize((0.4914, 0.4822, 0.4465), (0.2023, -.1994, 0.2010))
])

transform_test = transforms.Compose([
    transforms.ToTensor(),
    transforms.Normalize((0.4914, 0.4822, 0.4465), (0.2023, -.1994, 0.2010))
])

batch_size = 128

trainset = torchvision.datasets.CIFAR10(root = "./data", train = False, download = True, transform = transform_test)
trainLoader = torch.utils.data.DataLoader(trainset, batch_size=batch_size, shuffle = True, num_workers = 2)

testset = torchvision.datasets.CIFAR10(root="./data", train = False, download = True, transform = transform_test)
testLoader = torch.utils.data.DataLoader(testset, batch_size=batch_size, shuffle = False, num_workers = 2)

classes = ("plane", "car", "bird", "cat", "deer", "dog", "frog", "horse", "ship", "truck")

print("donee loading")

import torch.optim as optim

device = torch.device("cuda:0" if torch.cuda.is_available() else "cpu")
print(f"using: {device}")

model = GhostNet(num_classes=10, width_mult=1.0)
# model.conv1 = nn.Conv2d(3, model.in_channels, kernel_size=3, stride=1, padding=1, bias=False)
model = model.to(device=device)

lossfunc = nn.CrossEntropyLoss()

optimizer = optim.SGD(model.parameters(), lr=0.0001, momentum=1, weight_decay=5e-4)
scheduler = optim.lr_scheduler.CosineAnnealingLR(optimizer, T_max=200)

print("model, loss, optimizer and scheduler setup done")

import time

def train(epoch):
  print(f"epoch no.: {epoch}")
  model.train()
  train_loss = 0
  correct = 0
  total = 0
  start_time = time.time()

  for batch_id, (inputs, targets) in enumerate(trainLoader):
    inputs, targets = inputs.to(device), targets.to(device)
    optimizer.zero_grad() # clears the gradients
    outputs = model(inputs)
    loss = lossfunc(outputs, targets)
    loss.backward()
    optimizer.step()
    train_loss += loss.item()
    _, predicted = outputs.max(1)
    total += targets.size(0)
    correct += predicted.eq(targets).sum().item()

    epoch_time = time.time() - start_time
    if (batch_id + 1) % 100 == 0:
      print(f" BATCH {batch_id + 1}/{len(trainLoader)} | ")
      print(f" LOSS {epoch_time:.2f}s | ")
      print(f" ACC {100.*correct/total:.3f}%")

def test(epoch):
  model.eval()
  test_loss = 0
  correct = 0
  total = 0

  with torch.no_grad():
    for batch_id, (inputs, targets) in enumerate(testLoader):
      inputs, targets = inputs.to(device), targets.to(device)

      outputs = model(inputs)
      loss = lossfunc(outputs, targets)
      test_loss += loss.item()
      _, predicted = outputs.max(1)
      total += targets.size(0)
      correct += predicted.eq(targets).sum().item()

  acc = 100. * correct / total
  print(f"EPOCH {epoch} TESTING SUMMARY")
  print(f"LOSS {test_loss/len(testLoader):.3f}s | ")
  print(f"ACC {acc:.3f}% ({correct}/{total})")
  return acc

num_epochs = 200
best_acc = 0.0

print("=========================================")
print("==========STARTING TRAINING==============")
print("=========================================")

for epoch in range(num_epochs):
  train(epoch)
  acc = test(epoch)
  scheduler.step()
  if acc > best_acc:
    print(f"NEW BEST ACCURACY - WAS {best_acc:.3f}%; NOW: {acc:.3f}%")
    best_acc = acc

print("=========================================")
print(f"TRAINING FINISHED.")
print(f"BEST TEST ACCURACY: {best_acc:.3f}%")
